import React from "react";
import { View, Button, Text, StyleSheet } from "react-native";
import { Avatar,Card, Title, Paragraph  } from 'react-native-paper';

const Tools = () => {
  return (
    <View style={styles.center}>

    <Card style = {styles.card}>
    <Card.Title
    title="Scientific-Calculator"
    subtitle="Card Subtitle"
    left={(props) => <Avatar.Icon {...props} icon="calculator" />}
    />
    </Card>

    <Card style = {styles.card}>
    <Card.Title
    title="Unit-Convertion"
    subtitle="Card Subtitle"
    left={(props) => <Avatar.Icon {...props} icon="rotate-3d-variant" />}
    />
    </Card>

    <Card style = {styles.card}>
    <Card.Title
    title="Bluetooth-Control"
    subtitle="Card Subtitle"
    left={(props) => <Avatar.Icon {...props} icon="bluetooth-connect" />}
    />
    </Card>

    <Card style = {styles.card}>
    <Card.Title
    title= "Currency Converter"
    subtitle="Card Subtitle"
    left={(props) => <Avatar.Icon {...props} icon="scale-balance"  style = {{backgroundColor: "orange"}}/>}
    />
    </Card>

    </View>
  );
};

const styles = StyleSheet.create({
  center: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    textAlign: "center",
  },
  avt: {
    textAlign: "center"
  },
  card: {
    width: "90%",
    backgroundColor: "#f5f5f5",
    margin: 10
  }
});

export default Tools;
